const images = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,"
]

const ExampleFiles = ({onSelect}) => {
    return (
        <div style={{display: 'flex'}}>
            <div style={{alignSelf: 'center'}}>Exmaples:</div>
            {images.map((image, i) => {
                return (<img src={image}
                             style={{maxHeight: '50px', marginLeft: '10px'}}
                             alt={`Example image ${i}`}
                             key={i}
                             onClick={() => onSelect(image)}/>)
            })}
        </div>
    )
}

export default ExampleFiles